INSERT INTO `mensajesprocedimientos` (`Idmensaje`, `titulo`, `mensaje`, `Idmensaje_c`) VALUES
(1, 'NO ASISTIO CONTROL ORTODONCIA', 'NO ASISTIO A LA CITA DE CONTROL DE ORTODONCIA PROGRAMADA CADA 30 DIAS.', 1),
(8, 'FRENILLECTOMIA LABIAL', 'BAJO ANESTESIA LOCAL LIDOCAINA 2 % CON EPINEFRINA 1:80.000 SE REALIZA INCISION EN  FRENILLO LABIAL , RESECCION DE TEJIDO FIBROSO, RETIRO DE FRENILLO, HEMOSTASIA,  SUTURA  CON SEDA 3-0 SIN COMPLICACION\nSE DAN INDICACIONES CONTROL EN 8 DIAS\nSE MEDICA:\nCEFALEXINA CAP 500 MG VO CADA 6 HORAS\nMELCOX TAB 7.5 MG VO CADA 12 HORAS\n', 1),
(7, 'ODONTOLOGIA GENERAL', 'OPERATORIA', 1),
(6, 'EXODONCIAS TERCEROS  MOLARES', 'BAJO ANESTESIA LOCAL LIDOCAINA 2 % CON EPINEFRINA 1:80.000 SE REALIZA INCISION EN ZONA RETROMOLAR, ELEVAVION DE COLGAJO MUCOPERIOSTICO, OSTEOTOMIA, ODONTOSECCION DE 38 48 EXODONCIAS DE 18  38 48,  HEMOSTASIA, SUTURA SEDA 3-0,  PROCEDIMIENTO SIN COMPLICACION\nSE DAN INDICACIONES CONTROL EN 8 DIAS\nSE MEDICA:\nAZIBAY TAB  500 MG VO  1 CADA 24 HORAS\nAPRONAX TAB 550 MG VO CADA 12 HORAS\nALGIMIDE TAB 500/15 MG CADA 6 HORAS', 1),
(9, 'FRENILLECTOMIA LINGUAL', 'BAJO ANESTESIA LOCAL LIDOCAINA 2 % CON EPINEFRINA 1:80.000 SE REALIZA INCISION EN  FRENILLO LINGUALL , RESECCION DE TEJIDO FIBROSO, RETIRO DE FRENILLO, HEMOSTASIA,  SUTURA  CON SEDA 3-0 SIN COMPLICACION\nSE DAN INDICACIONES CONTROL EN 8 DIAS\nSE MEDICA:\nCEFALEXINA CAP 500 MG VO CADA 6 HORAS\nMELCOX TAB 7.5 MG VO CADA 12 HORAS', 1),
(10, 'IMPLANTE ', 'BAJO ANESTESIA LOCAL LIDOCAINA 2 % CON EPINEFRINA 1:80.000 SE REALIZA INCISION , ELEVAVION DE COLGAJO MUCOPERIOSTICO, OSTEOTOMIA DE PERFORACION SECUENCIAL, COLOCACION DE IMPLANTE DE TITANIO MIS -SEVE DE 3.75 X 13 MM SUTURA SEDA 3-0,  PROCEDIMIENTO SIN COMPLICACION\nSE DAN INDICACIONES CONTROL EN 8 DIAS\nSE MEDICA:\nCEFALEXINA CAP 500 MG VO CADA 6 HORAS\nMELCOX TAB 7.5 MG VO CADA 12 HORAS\nALGIMIDE TAB 500/15 MG CADA 6 HORAS\n', 1),
(11, 'MINI-IMPLANTE', 'BAJO ANESTESIA LOCAL LIDOCAINA 2 % CON EPINEFRINA 1:80.000 SE REALIZA PUNTO SANGRANTE , COLOCACION DE MINI IMPLANTE BIO RAY DE 1.5 X 8 MM PROCEDIMIENTO SIN COMPLICACION. NO CONSUMIR LACTEOS DURANTE LOS TRES DIAS SIGUIENTES. CONTROL EN 8 DIAS. SE MEDICA: DOLEX FORTE TAB. 500 MG # 12 , TOMAR 1 TAB C/D 6 HORAS.\n\n', 1),
(12, 'RETIRO DE SUTURAS', 'PACIENTE EN POSOPERATORIO DE 8 DIAS, SE EVIDENCIA ADECUADO PROCESO DE CICATRIZACION SE REALIZA LAVADO PROFUSI, RETIRO DE SUTURAS.', 1),
(13, 'CONTROL  CIRUGIA', 'SE EVIDENCIA ADECUADO PROCESO DE CICATRIZACION , NO DOLOR, NO EDEMA, NO SIGNOS DE INFECCION.', 1),
(14, 'CONTROL ATM', 'SE REALIZA MODIFICACION DE PLACA CON PUNTOS DE CONTACTO EN CUSPIDES FUNCIONALES, \nFISIOTERAPIA CON  TENS ( ELECTROESTIMULACION) POR 10 MIN EN MASETEROS Y PTERIGOIDEO EXTERNO.', 1),
(15, 'CAMUFLAJE', 'EL PACIENTE POR FACTORES ECONOMICOS Y TEMORES INFUNDIDOS (REMISICION PSICOLOGIA) RECHAZA EL TRATAMIENTO IDEAL QUE ES EL QUIRURGICO. SE LE EXPLICAN LAS LIMITACIONES DEL TRATAMIENTO DE CAMUFLAJE.\nEXPLICA QUE SE REALIZARAN EXODONCIAS DE 34-44 PARA MEJORAR EL OVERJET, LA PROQUELIA INFERIOR, DESCRUZAR LA MORDIDA EN TIJERA EN EL MAXILAR SUPERIOR Y CERRAR LA MORDIDA ABIERTA ANTERIOR.\nMEJORAR UN POCO EL PERFIL CONCAVO POR MEDIO DEL CAMUFLAJE. EL PACIENTE ESTA DE ACUERDO CON EL TRATAMIENTO 3 (CAMUFLAJE)', 1),
(16, 'EXODONCIA QUIRURGICA', 'BAJO ANESTESIA LOCAL LIDOCAINA 2 % CON EPINEFRINA 1:80.000 SE REALIZA INCISION , ELEVAVION DE COLGAJO MUCOPERIOSTICO, OSTEOTOMIA, EXODONCIAS DE         ,  HEMOSTASIA, SUTURA SEDA 3-0,  PROCEDIMIENTO SIN COMPLICACION\nSE DAN INDICACIONES DE CUIDADO,  CONTROL EN 8 DIAS\nSE MEDICA:\nCEFALEXINA CAP 500 MG VO CADA 6 HORAS\nMELCOX TAB 7.5 MG VO CADA 12 HORAS\nALGIMIDE TAB 500/15 MG CADA 6 HORAS', 1),
(17, 'CONTROL INICIAL ORTOPEDIA MAXILAR', 'SE ENTREGA APARATOLOGIA ORTOPEDICA MAXILAR SN 3 -SE DAN INSTRUCCIONES DE USO Y CUIDADOS. USO DIURNO Y NOCTURNO.CONTROL PARA ACTIVAR EN 15 DIAS', 1),
(24, 'CONTROL ORTODONCIA FASE TRABAJO', 'ARCOS DE ACERO 0.019X0.025 SUP. E INFERIOR', 1),
(25, 'CONTROL ORTOPEDIA MAXILAR', 'ACTIVACION TORNILLO DE EXPANSION 2/4 DE VUELTA-ARCO EN CONTACTO- ALIVIO DE ACRILICO EN', 1),
(18, 'REGULARIZACION DE REBORDE', 'BAJO ANESTESIA LOCAL 1.8 CC LIDOCAINA 2% CON EPINEFRINA SE REALIZA REGULARIZACION DE REBORDE INFERIOR-ANTERIOR SIN COMPLICACION -MELCOX 15 MG CADA 24 H -ADOREM 500 CADA 6 H', 1),
(19, 'OTRAS CIRUGIAS', 'BAJO ANESTESIA LOCAL 1.8 CC LIDOCAINA 2% CON EPINEFRINA SE REALIZA                                SIN COMPLICACION -MELCOX 15 MG CADA 24 H -ADOREM 500 CADA 6 H', 1),
(20, 'CIRUGIA', 'SE LE REALIZO UNA CIRUGIA ORTOGNATICA', 1),
(21, 'FASE DE ALINEACION Y NIVELACION', 'ARCOS NITI 0.012', 1),
(22, 'OPERCULECTOMIA', 'ANESTESIA LOCAL LIDOCAINA CON EPINEFRINA 1:80.000 SE REALIZA REMOCION DE CAPUCHON PERICORONARIO.\nMEDICA AMOXAL, TAB 500 MG # 21\nTOMAR 1 TABLETA C/D 8 HORAS\nBENZIRIN FORTE, FRASCO SPRAY #1\nAPLICAR EN LA ZONA AFECTADA SEGUN DOLOR', 1),
(23, 'CONTROL DE ORTODONCIA FASE NIVELACION Y ALINEACION', 'FASE DE NIVELACION Y ALINEACION. ARCOS DE NITI 0.014 SUP.  E INFERIOR', 1),
(26, 'PROTESIS EN FLEXIDEN-CUIDADOS', 'NO LAVAR LA PROTESIS CON CREMA DENTAL(PORQUE PUEDE TOMAR UN COLOR BLANQUECINO), SOLO CON DETERGENTE, USAR CEPILLO DE CERDAS DURAS (DIFERENTE AL DE USO DIARIO), DESINFECTAR LA PROTESIS UNA VEZ A LA SEMANA CON HIPOCLORITO DE SODIO EN PROPORCION DE 1 A 3 DE AGUA, MANDARLA A PULIR EN EL LABORATORIO 1 VEZ AL AÑO (COSTO ADICIONAL $100.000)', 1),
(27, 'PACIENTE SIN ASISTIR A MAS DE 2 CONTROLES', 'PACIENTE SIN ASISTIR A CONTROLES DESDE HACE MAS DE 2 MESES, SE LE RECUERDA LA IMPORTACIA DE ASISTIR A LAS CITAS PROGRAMADAS CADA 30 DIAS DEBIDO A LAS ALTERACIONES OSEAS Y REABSORCIONES RADICULARES QUE SE PUEDEN ORIGINAR POR LA FALTA DE CONTROLES MENSUALES ALTERANDO ESTO EL TIEMPO Y DURACION DEL TRATAMIENTO Y ACARREANDO COSTOS ADICIONALES POR LA PROLONGACION DEL TRATAMIENTO.', 1),
(28, 'PACIENTE SIN ASISTIR PARA ENTREGA DEFINITIVA DE CORONAS', 'SE LLAMA POR TERCERA VEZ A LA PACIENTE PARA CITARLA PARA CEMENTACION DE CORONA DEFINITIVA METAL PORCELNA, Y NO ASISTE A LA CITA. SE ENCUENTRA SIN TEMPORAL POR PERDIDA POR PARTE DE LA PACIENTE, SE LE RECUERDA QUE SE PUEDEN PRODUCIR MOVIMIENTO DENTARIOS LOS CUALES ALTERARIAN EL AJUSTE Y UNA CORRECTA OCLUSION, QUE PUEDEN ACARREAR COSTOS ADICIONALES POR NO TENER EN CUENTA LAS OBSERVACIONES ANTERIORMENTE DESCRITAS.', 1),
(29, 'PROTESIS FLEXIDENT-RECOMENDACIONES', 'MEDIDAS PARA CONSERVAR EN BUENAS CONDICIONES  LAS PROTESIS REMOVIBLE EN FLEXIDENT.\n1. LAVAR LA PROTESIS SIEMPRE CON DETERGENTE, NUNCA LAVARLA CON PASTA DENTAL U OTRA SUSTANCIA LIMPIADORA, INCLUYENDO JABÓN NEUTRO O DE TOCADOR.\n2.USAR CEPILLO DE CERDAS SUAVES QUE SEA EXCLUSIVO PARA LA PRÓTESIS Y NO USAR EL DE USO DIARIO PARA EL ASEO BUCAL.\n3.NO DORMIR CON LA O LAS PROTESIS.\n4.SUMERGIRLA POR LO MENOS 1 VEZ A LA SEMANA DURANTE 1 MINUTO EN HIPOCLORITO DE SODIO (CLORO). EN RELACION DE 3 MEDIDAS DE AGUA POR 1 DE CLORO. ENJUAGAR LA PROTESIS DESPUËS DE ESTE PROCEDIMIENTO.\n5.SI POR ERROR LA PRÖTESIS FUERA LAVADA CON PASTA DENTAL, PUEDE TOMAR UN COLOR BLANQUESINO, ESTO SE SOLUCIONA FÄCILMENTE, MANDANDO A PULIR LA PROTESIS EN EL LAVORATORIO QUE FUE ELABORADA (CON UN COSTO ADICIONAL).\n6.MANDAR PULIR LA PRÖTESIS POR LO MENOS 1 VEZ POR AÑO.', 1),
(30, 'PERFILADO GINGIVAL', 'PERFILADO GINGIVAL. SE ANESTESIA CON ROXICAINA AL 2%  1:80.000 (4) CAPULAS, GINGIVECTOMIA CON ELECTRO-BISTURI PARA NIVELAR PUNTOS ZENIT, ELEVACION DE COLGAJO COMPLETO, OSTEOPLASTIA PARA RECUPERAR EL ESPESOR BIOLOGICO, SUTURA. INDICACIONES POSTQUIRURGICAS Y FORMULA. SE MEDICA DICLOFENACO TAB 50 MG Y AMOXACILINA 500 MG CADA 8 HORAS POR 7 DIAS. ', 1),
(31, 'NO ASISTIO A CONTROL DE ORTOPEDIA MAXILAR', 'NO ASISTIO A CONTROL DE ORTOPEDIA MAXILAR, PROGRAMADO CADA 15 DIAS', 1),
(32, 'ORDEN DE SERVICIO', 'POR FAVOR EMITIR ORDENES PARA LOS SIGUIENTES SERVICIOS\n\nCODIGO 231301\nEXODONCIA DE INCLUIDO CON ABORDAJE INTRAORAL\n\nCODIGO 760902\nCURETAJE OSEO EN HUESO FACIAL\n\nCODIGO 237902\nEXPLORACION Y/O MOVILIZACION DE NERVIO\nDENTARIO INFERIOR', 3),
(33, 'CERTIFICADO DE INCAPACIDAD', 'CERTIFICADO DE INCAPACIDAD\n\nINCAPACIDAD DESDE         HASTA EL     (     ) DIAS\nPOR REALIZACION DE CIRUGIA BUCAL ABIERTA', 3),
(34, 'MEDICAMENTOS CIRUGIA', 'R/\n\n\n   ( 1 ) AMOXIXILINA CAPS 500mg # 21\n           Tomar 1 cápsula v.o cada 8 Horas.\n\n    ( 2 ) IBUPROFENO TAB. 800mg #12\n           Tomar 1 cápsula v.o cada 6-8 Horas.\n\n   ( 2 ) DICLOFENACO AMP. 75mg 2 ml # 3\n           Aplicar 1 ampolla intramuscular cada 8 horas.', 3),
(35, 'RESINAS', '<JDHFKJSDF ASDJLFAJSHDF ADHFAHDFAJHDÑJ LADHFALJHD', 1),
(36, 'RESINAS', 'ASÑSJDLAKJ LKJDFLKJSDLKFJLS ÑJDFLKSJDFL JSDFLJDLKJF', 4);
